namespace Sym17.Web.Controllers
{
    using System;
    using System.Web.Mvc;

    using Filters;

    using Models.Contact;
    using Models.Facets.Interaction;
    using Models.ViewModels;

    using Services;

    [AllowCrossSiteJson]
    public class ContactController : Controller
    {
        private Xservice _xservice = new Xservice();

        public ActionResult SetVisitor(ImageProcessingContact contact)
        {
            ActiveVisitor.Set(contact);

            return new EmptyResult();
        }

        public ActionResult Identify(string email)
        {
            _xservice.Identify(Settings.FaceApiIdentificationSource, ActiveVisitor.Get().Id, Settings.EmailIdentificationSource, email);

            return new EmptyResult();
        }

        public ActionResult Test()
        {
            ContactViewModel model = _xservice.TestClient();
            return View(model);
        }

        [HttpPost]
        public bool Add(ImageProcessingContact contact)
        {
            if (contact != null)
            {
                contact.Created = DateTime.Now;
                if (!string.IsNullOrEmpty(contact.Photo))
                {
                    contact.Image = Convert.FromBase64String(contact.Photo);
                }
                ActiveVisitor.Set(contact);
                return true;
            }
            return false;
        }

        [HttpPost]
        public bool Save(ContactViewModel model)
        {
            Sitecore.Diagnostics.Log.Info("Try to save contact " + model.Email, this);
            if (string.IsNullOrWhiteSpace(model?.Email))
            {
                return false;
            }

            try
            {
                _xservice.SetEmail(model.Email);
                _xservice.UpdateContact(model);
                _xservice.RegisterOnlineInteraction(Settings.FaceApiIdentificationSource, ActiveVisitor.Get().Id);

                return true;
            }
            catch (Exception ex)
            {
                Sitecore.Diagnostics.Log.Error(ex.Message, this);
                return false;
            }
        }

        [HttpPost]
        public bool AddFaceInteraction(FaceInteractionRequestModel model)
        {
            if (model == null || ActiveVisitor.Get() == null)
            {
                return false;
            }

            FaceApiFacet facet = new FaceApiFacet()
            {
                AngerValue = model.AngerValue,
                ContemptValue = model.ContemptValue,
                DisgustValue = model.DisgustValue,
                FearValue = model.FearValue,
                HappinessValue = model.HappinessValue,
                NeutralValue = model.NeutralValue,
                SadnessValue = model.SadnessValue,
                SmileValue = model.SmileValue,
                SurpriseValue = model.SurpriseValue
            };

            //_xservice.RegisterOfflineInteraction(Settings.FaceApiIdentificationSource, ActiveVisitor.Get().Id, facet);

            return true;
        }

        public void TestHub()
        {
            var test = new ImageProcessingContact
            {
                Age = 45,
                Company = "brimit", // v" + DateTime.UtcNow.Second,
                Created = DateTime.Now,
                FirstName = "Julia",
                LastName = "Baranova",
                Gender = "Female",
                Id = DateTime.UtcNow.Ticks.ToString(),
                Photo = @"",
                Photo48 = @""
            };
            ActiveVisitor.Set(test);
        }
    }
}